import React from 'react';
import './button.css';

function Button(props) {
  const { size } = props;

  const buttonClass = size === 'medium' ? 'medium' : size === 'low' ? 'low' : 'high';

  return (
    <button type="button" className={buttonClass} size = {size}>
    {size}
    </button>
  );
}

export default Button;
